ug\";s:26:\"advanced-custom-fields-pro\";s:7:\"version\";s:6:\"6.3.10\";s:8:\"homepage\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"author\";s:155:\"<a href=\"https://wpengine.com/?utm_source=wordpress.org&utm_medium=referral&utm_campaign=plugin_directory&utm_content=advanced_custom_fields\">WP Engine</a>\";s:12:\"contributors\";a:9:{s:15:\"deliciousbrains\";a:3:{s:7:\"profile\";s:47:\"https://profiles.wordpress.org/deliciousbrains/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/c55b6dfd266f44f127170d402922e485?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:16:\"Delicious Brains\";}s:8:\"wpengine\";a:3:{s:7:\"profile\";s:40:\"https://profiles.wordpress.org/wpengine/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/6d44461b684d2f3d8f6fcf3d657cb889?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:9:\"WP Engine\";}s:12:\"elliotcondon\";a:3:{s:7:\"profile\";s:44:\"https://profiles.wordpress.org/elliotcondon/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/533079e82e526367047100d8019cb9a7?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:13:\"Elliot Condon\";}s:8:\"mattshaw\";a:3:{s:7:\"profile\";s:40:\"https://profiles.wordpress.org/mattshaw/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/c0ec3df5b2d5cf25ca1ab1fc3fdbe270?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:9:\"Matt Shaw\";}s:7:\"lgladdy\";a:3:{s:7:\"profile\";s:39:\"https://profiles.wordpress.org/lgladdy/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/1c126b5df1afc631b50bae0dda8094d7?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:11:\"Liam Gladdy\";}s:5:\"antpb\";a:3:{s:7:\"profile\";s:37:\"https://profiles.wordpress.org/antpb/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/9fe91e0d637984c9d4bb6d2f27cd7eb4?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:16:\"Anthony Burchell\";}s:14:\"johnstonphilip\";a:3:{s:7:\"profile\";s:46:\"https://profiles.wordpress.org/johnstonphilip/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/459d1a78b2c7c46729a175c372a9be4f?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:13:\"Phil Johnston\";}s:12:\"dalewilliams\";a:3:{s:7:\"profile\";s:44:\"https://profiles.wordpress.org/dalewilliams/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/c0528da391a7f8b5a403404224347421?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:13:\"Dale Williams\";}s:12:\"polevaultweb\";a:3:{s:7:\"profile\";s:44:\"https://profiles.wordpress.org/polevaultweb/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/920dd5ed3b01d7185cc421e15e75ef07?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:12:\"Iain Poulson\";}}s:8:\"requires\";s:3:\"6.0\";s:12:\"requires_php\";s:3:\"7.4\";s:6:\"tested\";s:5:\"6.6.2\";s:5:\"added\";s:10:\"2024-10-29\";s:12:\"last_updated\";s:10:\"2024-10-29\";s:11:\"description\";s:5268:\"<p>Advanced Custom Fields (ACF) turns WordPress sites into a fully-fledged content management system by giving you all the tools to do more with your data.</p>\n\n<p>Use the ACF plugin to take full control of your WordPress edit screens, custom field data, and more.</p>\n\n<p>https://www.youtube.com/watch?v=9C6_roqghZQ&rel=0</p>\n\n<p><strong>Add fields on demand.</strong></p>\n<p>The ACF field builder allows you to quickly and easily add fields to WP edit screens with only the click of a few buttons! Whether it\'s something simple like adding an “author” field to a book review post, or something more complex like the structured data needs of an ecommerce site or marketplace, ACF makes adding fields to your content model easy.</p>\n\n<p><strong>Add them anywhere.</strong></p>\n<p>Fields can be added all over WordPress including posts, pages, users, taxonomy terms, media, comments and even custom options pages! It couldn\'t be simpler to bring structure to the WordPress content creation experience.</p>\n\n<p><strong>Show them everywhere.</strong></p>\n<p>Load and display your custom field values in any theme template file with our hassle-free, developer friendly functions! Whether you need to display a single value or generate content based on a more complex query, the out-of-the-box functions of ACF make templating a dream for developers of all levels of experience.</p>\n\n<p><strong>Any Content, Fast.</strong></p>\n<p>Turning WordPress into a true content management system is not just about custom fields. Creating new custom post types and taxonomies is an essential part of building custom WordPress sites. Registering post types and taxonomies is now possible right in the ACF UI, speeding up the content modeling workflow without the need to touch code or use another plugin.</p>\n\n<p><strong>Simply beautiful and intentionally accessible.</strong></p>\n<p>For content creators and those tasked with data entry, the field user experience is as intuitive as they could desire while fitting neatly into the native WordPress experience. Accessibility standards are regularly reviewed and applied, ensuring ACF is able to empower as close to anyone as possible.</p>\n\n<p><strong>Documentation and developer guides.</strong></p>\n<p>Over 10 plus years of vibrant community contribution alongside an ongoing commitment to clear documentation means that you\'ll be able to find the guidance you need to build what you want.</p>\n\n<h4>Features</h4>\n<ul>\n<li>Simple & Intuitive</li>\n<li>Powerful Functions</li>\n<li>Over 30 Field Types</li>\n<li>Extensive Documentation</li>\n<li>Millions of Users</li>\n</ul>\n\n<h4>Links</h4>\n<ul>\n<li><a href=\"https://www.advancedcustomfields.com/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Website\">Website</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/resources/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Website\">Documentation</a></li>\n<li><a href=\"https://support.advancedcustomfields.com\">Support</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/pro/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">ACF PRO</a></li>\n</ul>\n\n<h4>PRO</h4>\n<p>The Advanced Custom Fields plugin is also available in a professional version which includes more fields, more functionality, and more flexibility. The ACF PRO plugin features:</p>\n\n<ul>\n<li>The <a href=\"https://www.advancedcustomfields.com/resources/repeater/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Repeater Field</a> allows you to create a set of sub fields which can be repeated again, and again, and again.</li>\n<li><a href=\"https://www.advancedcustomfields.com/resources/blocks/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">ACF Blocks</a>, a powerful PHP-based framework for developing custom block types for the WordPress Block Editor (aka Gutenberg).</li>\n<li>Define, create, and manage content with the <a href=\"https://www.advancedcustomfields.com/resources/flexible-content/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Flexible Content Field</a>, which provides for multiple layout and sub field options.</li>\n<li>Use the <a href=\"https://www.advancedcustomfields.com/resources/options-page/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Options Page</a> feature to add custom admin pages to edit ACF fields.</li>\n<li>Build fully customisable image galleries with the <a href=\"https://www.advancedcustomfields.com/resources/gallery/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Gallery Field</a>.</li>\n<li>Unlock a more efficient workflow for managing field settings by reusing existing fields and field groups on demand with the <a href=\"https://www.advancedcustomfields.com/resources/clone/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Clone Field</a>.</li>\n</ul>\n\n<p><a href=\"https://www.advancedcustomfields.com/pro/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Upgrade to ACF PRO</a></p>\";s:12:\"installation\";s:649:\"<p>From your WordPress dashboard</p>\n\n<ol>\n<li><strong>Visit</strong> Plugins > Add New</li>\n<li><strong>Search</strong> for \"Advanced Custom Fields\" or “ACF”</li>\n<li><strong>Install and Activate</strong> Advanced Custom Fields from your Plugins page</li>\n<li><strong>Click</strong> on the new menu item \"ACF\" and create your first custom field group, or register a custom post type or taxonomy.</li>\n<li><strong>Read</strong> the documentation to <a href=\"https://www.advancedcustomfields.com/resources/getting-started-with-acf/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Website\">get started</a></li>\n</ol>\";s:9:\"changelog\";s:1671:\"<h4>6.3.10</h4>\n<p><em>Release Date 29th October 2024</em></p>\n\n<ul>\n<li>Security - Setting a metabox callback for custom post types and taxonomies now requires being an admin, or super admin for multisite installs</li>\n<li>Security - Field specific ACF nonces are now prefixed, resolving an issue where third party nonces could be treated as valid for AJAX calls</li>\n<li>Enhancement - A new “Close and Add Field” option is now available when editing a field group, inserting a new field inline after the field being edited</li>\n<li>Enhancement - ACF and ACF PRO now share the same plugin updater for improved reliability and performance</li>\n<li>Fix - Exporting post types and taxonomies containing metabox callbacks now correctly exports the user defined callback</li>\n</ul>\n\n<h4>6.3.9</h4>\n<p><em>Release Date 15th October 2024</em></p>\n\n<ul>\n<li>Security - Editing an ACF Field in the Field Group editor can no longer execute a stored XSS vulnerability. Thanks to Duc Luong Tran (janlele91) from Viettel Cyber Security for the responsible disclosure</li>\n<li>Security - Post Type and Taxonomy metabox callbacks no longer have access to any superglobal values, hardening the original fix from 6.3.8 further</li>\n<li>Fix - ACF fields now correctly validate when used in the block editor and attached to the sidebar</li>\n</ul>\n\n<h4>6.3.8</h4>\n<p><em>Release Date 7th October 2024</em></p>\n\n<ul>\n<li>Security - ACF defined Post Type and Taxonomy metabox callbacks no longer have access to $_POST data. (Thanks to the Automattic Security Team for the disclosure)</li>\n</ul>\n\n<p><a href=\"https://www.advancedcustomfields.com/changelog/\">View the full changelog</a></p>\";s:14:\"upgrade_notice\";s:0:\"\";s:5:\"icons\";a:1:{s:7:\"default\";s:64:\"https://connect.advancedcustomfields.com/assets/icon-256x256.png\";}s:7:\"banners\";a:2:{s:3:\"low\";s:66:\"https://connect.advancedcustomfields.com/assets/banner-772x250.jpg\";s:4:\"high\";s:67:\"https://connect.advancedcustomfields.com/assets/banner-1544x500.jpg\";}s:8:\"versions\";a:206:{i:0;s:5:\"6.3.9\";i:1;s:5:\"6.3.8\";i:2;s:5:\"6.3.7\";i:3;s:5:\"6.3.6\";i:4;s:5:\"6.3.5\";i:5;s:5:\"6.3.4\";i:6;s:5:\"6.3.3\";i:7;s:7:\"6.3.2.1\";i:8;s:5:\"6.3.2\";i:9;s:7:\"6.3.1.2\";i:10;s:7:\"6.3.1.1\";i:11;s:5:\"6.3.1\";i:12;s:7:\"6.3.0.1\";i:13;s:5:\"6.3.0\";i:14;s:11:\"6.3.0-beta1\";i:15;s:6:\"6.2.10\";i:16;s:5:\"6.2.9\";i:17;s:5:\"6.2.8\";i:18;s:9:\"6.2.8-RC1\";i:19;s:5:\"6.2.7\";i:20;s:7:\"6.2.6.1\";i:21;s:5:\"6.2.6\";i:22;s:5:\"6.2.5\";i:23;s:5:\"6.2.4\";i:24;s:5:\"6.2.3\";i:25;s:5:\"6.2.2\";i:26;s:7:\"6.2.1.1\";i:27;s:5:\"6.2.1\";i:28;s:5:\"6.2.0\";i:29;s:9:\"6.2.0-RC1\";i:30;s:11:\"6.2.0-beta1\";i:31;s:5:\"6.1.8\";i:32;s:5:\"6.1.7\";i:33;s:5:\"6.1.6\";i:34;s:5:\"6.1.5\";i:35;s:5:\"6.1.4\";i:36;s:5:\"6.1.3\";i:37;s:5:\"6.1.2\";i:38;s:5:\"6.1.1\";i:39;s:5:\"6.1.0\";i:40;s:11:\"6.1.0-beta1\";i:41;s:12:\"6.1.0-alpha1\";i:42;s:5:\"6.0.7\";i:43;s:5:\"6.0.6\";i:44;s:5:\"6.0.5\";i:45;s:5:\"6.0.4\";i:46;s:5:\"6.0.3\";i:47;s:5:\"6.0.2\";i:48;s:5:\"6.0.1\";i:49;s:5:\"6.0.0\";i:50;s:9:\"6.0.0-RC3\";i:51;s:9:\"6.0.0-RC2\";i:52;s:9:\"6.0.0-RC1\";i:53